    false,nt"url": null,nt"notes": "Location and purpose of survey; topography
    and physiography of study area; general geology of area; structural features; summary
    of characteristics of thermal springs in area; gravity data from four surveys and
    1099 stations; errors associated with gravity data compilation; density measurements
    and sample collections; drill hole information from 12 water wells, one wildcat
    oil and gas well, and one deep ore drill hole; complete Bouguer gravity anomaly
    map with two-mgal contour interval; gravity characteristics of fault zones and local
    horsts; gravity profiles and interpretive geologic cross sections; interrelationship
    of fault blocks as interpreted from the gravity data; geothermal significance of
    gravity survey; summary and conclusions; appendices showing principal facts of gravity
    stations, density measurements of rocks, and well logs.n",nt"license_title":
